// ... (imports iguales)

function App() {
  const location = useLocation();
  const isAdminRoute = location.pathname.startsWith('/admin');

  return (
    <>
      {!isAdminRoute && <Header />}

      <Suspense fallback={<PageLoader />}>
        <main className={isAdminRoute ? '' : 'main-content'}>
          <Routes>
            {/* Rutas Públicas */}
            <Route path="/" element={<Home />} />
            <Route path="/products" element={<Products />} />
            <Route path="/product/:id" element={<ProductDetail />} />
            <Route path="/cart" element={<Cart />} />
            <Route path="/checkout" element={<Checkout />} />

            <Route path="/login" element={<Login />} />
            {/* CORREGIDO: Solo una ruta para register apuntando al componente Register */}
            <Route path="/register" element={<Register />} />
            <Route path="/forgot-password" element={<ForgotPassword />} />

            <Route path="/categoria/:categorySlug" element={<Products />} />

            {/* Estas rutas de abajo suelen ir dentro de Profile, 
                pero si las quieres directas, asegúrate de que existan */}
            <Route path="/notifications" element={<NotificationsTab />} />
            <Route path="/orders" element={<OrdersTab />} />
            <Route path="/security" element={<SecurityTab />} />

            {/* Ruta de Perfil Unificada */}
            <Route 
              path="/perfil/*" 
              element={
                <ProtectedRoute>
                  <Profile />
                </ProtectedRoute>
              } 
            />

            {/* Rutas de Admin */}
            <Route 
              path="/admin" 
              element={
                <ProtectedRoute requireAdmin={true}>
                  <AdminLayout />
                </ProtectedRoute>
              }
            >
              <Route index element={<AdminDashboard />} />
              <Route path="productos" element={<AdminProducts />} />
              <Route path="categorias" element={<AdminCategories />} />
              <Route path="pedidos" element={<AdminOrders />} />
              <Route path="usuarios" element={<AdminUsers />} />
              <Route path="chat" element={<AdminChat />} />
            </Route>
          </Routes>
        </main>
      </Suspense>

      {!isAdminRoute && <ChatButton />}
      {!isAdminRoute && <Footer />}
    </>
  );
}

export default App;
